BlocklyGamesMsg["Music.helpText2b"] = "'ಫ್ರೆರೆ ಜಾಕ್ವೆಸ್' ನ ಮೊದಲ ನಾಲ್ಕು ನೋಟ್ ಗಳನ್ನು ನುಡಿಸಲು ಒಂದು ಕಾರ್ಯಘಟಕವನ್ನು ರಚಿಸಿ. ಆ ಕಾರ್ಯಘಟಕವನ್ನು ಎರಡು ಬಾರಿ ಚಲಾಯಿಸಿ. ಯಾವುದೇ ಹೊಸ ನೋಟ್ ಬ್ಲಾಕ್ ಗಳನ್ನು ಸೇರಿಸಬೇಡಿ.";
BlocklyGamesMsg["Music.helpText3"] = "'ಫ್ರೆರೆ ಜಾಕ್ವೆಸ್' ನ ಮುಂದಿನ ಭಾಗಕ್ಕೆ ಎರಡನೇ ಕಾರ್ಯ  ಘಟಕವನ್ನು ರಚಿಸಿ. ಕೊನೆಯ ನೋಟ್  ದೀರ್ಘವಾಗಿದೆ.";
BlocklyGamesMsg["Music.helpText4"] = "'ಫ್ರೆರೆ ಜಾಕ್ವೆಸ್' ನ ಮುಂದಿನ ಭಾಗಕ್ಕೆ ಮೂರನೇ ಕಾರ್ಯಘಟಕವನ್ನು ರಚಿಸಿ. ಮೊದಲ ನಾಲ್ಕು ನೋಟ್ ಗಳು  ಲಘುವಾಗಿರುತ್ತವೆ.";
