BlocklyGamesMsg["Music.helpText6a"] = "ಈ ಹೊಸ ಬ್ಲಾಕ್ ನಿಮಗೆ ಮತ್ತೊಂದು ವಾದ್ಯಕ್ಕೆ ಬದಲಾಯಿಸಲು ಅನುವು ಮಾಡಿಕೊಡುತ್ತದೆ.";
