BlocklyGamesMsg["Music.helpText8"] = "ಪ್ರತಿ ಸ್ಟಾರ್ಟ್ ಬ್ಲಾಕ್ ಎರಡು ಬಾರಿ 'ಫ್ರೆರೆ ಜಾಕ್ವೆಸ್' ಅನ್ನು ನುಡಿಸಬೇಕು.";
BlocklyGamesMsg["Music.helpText9"] = "ಪ್ರತಿಯೊಂದೂ ಎರಡು ಬಾರಿ 'ಫ್ರೆರೆ ಜಾಕ್ವೆಸ್' ಆಡುವ ನಾಲ್ಕು ಸ್ಟಾರ್ಟ್ ಬ್ಲಾಕ್‌ಗಳನ್ನು ರಚಿಸಿ. ಸರಿಯಾದ ಸಂಖ್ಯೆಯ ವಿಳಂಬ ಬ್ಲಾಕ್‌ಗಳನ್ನು ಸೇರಿಸಿ.";
