BlocklyGamesMsg["Pond.helpText1"] = "ಗುರಿಯನ್ನು ಹೊಡೆಯಲು 'cannon' ಆದೇಶವನ್ನು ಬಳಸಿ. ಮೊದಲ ನಿಯತಾಂಕವು ಕೋನ, ಎರಡನೆಯ ನಿಯತಾಂಕವು ವ್ಯಾಪ್ತಿ. ಸರಿಯಾದ ಸಂಯೋಜನೆಯನ್ನು ಕಂಡುಕೊಳ್ಳಿ.";
BlocklyGamesMsg["Pond.helpText2"] = "ಈ ಗುರಿಯನ್ನು ಹಲವು ಬಾರಿ ಹೊಡೆಯಬೇಕಾಗಿದೆ. ಏನನ್ನಾದರೂ ಅನಿರ್ದಿಷ್ಟವಾಗಿ ಮಾಡಲು 'while (true)' ಲೂಪ್ ಅನ್ನು ಬಳಸಿ.";
BlocklyGamesMsg["Pond.helpText3a"] = "ಈ ಎದುರಾಳಿಯು ಹಿಂದಕ್ಕೆ ಮತ್ತು ಮುಂದಕ್ಕೆ ಚಲಿಸುವುದರಿಂದ, ಹೊಡೆಯಲು ಕಷ್ಟವಾಗುತ್ತದೆ. 'scan' ಆದೇಶವು ನಿರ್ದಿಷ್ಟಪಡಿಸಿದ ದಿಕ್ಕಿನಲ್ಲಿ ಎದುರಾಳಿಯ ನಿಖರವಾದ ವ್ಯಾಪ್ತಿಯನ್ನು ನೀಡುತ್ತದೆ.";
