BlocklyGamesMsg["Pond.helpText4"] = "ಈ ಎದುರಾಳಿಯು ಫಿರಂಗಿಯನ್ನು ಬಳಸಲು ತುಂಬಾ ದೂರದಲ್ಲಿದ್ದಾರೆ(ಫಿರಂಗಿ 70 ಮೀಟರ್ ವ್ಯಾಪ್ತಿ ಹೊಂದಿದೆ). ಬದಲಾಗಿ,  'swim' ಆದೇಶವನ್ನು ಬಳಸಿ ಎದುರಾಳಿಯ ಕಡೆಗೆ ಈಜಲು ಪ್ರಾರಂಭಿಸಿ ಮತ್ತು ಎದುರಾಳಿಗೆ ಅಪ್ಪಳಿಸಿ.";
BlocklyGamesMsg["Pond.helpText5"] = "ಈ ಎದುರಾಳಿ ಕೂಡ ಫಿರಂಗಿಯನ್ನು ಬಳಸಲು ತುಂಬಾ ದೂರದಲ್ಲಿದ್ದಾರೆ. ಆದರೆ ಘರ್ಷಣೆಯಿಂದ ಬದುಕುಳಿಯಲು ನೀವು ತುಂಬಾ ದುರ್ಬಲರಾಗಿದ್ದೀರಿ. ನಿಮ್ಮ ಸಮತಲ ಸ್ಥಾನವು 50ಕ್ಕಿಂತ ಕಡಿಮೆಯಿದ್ದರೆ ಎದುರಾಳಿಯ ಕಡೆಗೆ ಈಜಿಕೊಳ್ಳಿ. ನಂತರ 'stop' ಮತ್ತು ಫಿರಂಗಿಯನ್ನು ಬಳಸಿ.";
BlocklyGamesMsg["Pond.helpText6"] = "ಈ ಎದುರಾಳಿ ಹೊಡೆದಾಗ ಅದು ದೂರ ಸರಿಯುತ್ತದೆ. ಅದು ವ್ಯಾಪ್ತಿಯಿಂದ ಹೊರಗಿದ್ದರೆ (70 ಮೀಟರ್) ಅದರ ಕಡೆಗೆ ಈಜಿಕೊಳ್ಳಿ.";
